import React from "react";
import Category from "../child/Category";

const Books = () =>{
    return(
        <>
            <div class="container">
                <div class="row">
                    <div class="col-md-3">
                        <Category />
                    </div>
                    <div class="col-md-9">

                    </div>
                </div>
            </div>
        </>
    );
}
export default Books;
